import React from "react";
const Divide = ({ data }) => {
  const styles = {
    width: "350px",
    height: "300px",
    backgroundColor: { data },
    border: "2px solid black",
  };
  return (
    <div
      style={{
        width: "350px",
        height: "350px",
        backgroundColor: { data },
        border: "2px solid red",
      }}
    ></div>
  );
};
export default Divide;
